import React from 'react';

import "../../../scss/InfoUser.scss";
const InfoUser = (props) => {
    const {user} = props;
    console.log(user);
    return (
        <div className="info-user">
            <h3 className="names">{user?.nombre} {user?.apellido} </h3>
        </div>
    );
}
export default InfoUser;
